import React, { Component } from 'react';
import "./Output.css";
class Output extends Component{
    constructor(props){
        super(props);
        console.log(props);
        console.log(props.data.userName);
    }


    render(){
        return(
            <div className='Output'>
                    <h1>Output</h1>
                <div id="personalOutput">
                    <h2 id="userName">{this.props.data.firstName + " " + this.props.data.lastName} </h2>
                    <h4 id="title">{this.props.data.title}</h4>
                        <i class="fa fa-phone-flip" aria-hidden="true"></i>: {this.props.data.phone}<br/>
                    Mail: {this.props.data.mail} <br/>
                    Address: {this.props.data.address}<br/>
                    {this.props.data.brandLogo && <img src={this.props.data.brandLogo} alt="logo" id="brandLogoOutput"/>}

                    Brand: {this.props.data.brand}<br/>
                    Slogan: {this.props.data.slogan} <br/>

                </div>
                <div id="otherSide">
                    <div id="otherTop">
                        <span id="fnOT">
                            {this.props.data.firstName}

                        </span>
                    </div>
                    <div id="otherBottom">
                        <span id="lnOT">
                            {this.props.data.lastName}

                        </span>
                    </div>
                </div>

            </div>
        )
    }
}
export default Output;
